(31, 'Veronique CHAPALAIN', '2018-03-07', '2018-03-07', NULL, 8, 2, 4, '', '', '', 'Construction d\'une requête permettant de récupérerer la date du lundi et samedi dernier. En vue d\'adresser au SI une demande de création de filtres pour les univers IBE et Cases Clarify SC.\r\n\r\nIci l\'arbre est ajouté', 1, 0),
