(38, 'Corinne MAGLOIRE', '2018-03-09', '2018-03-09', NULL, 3, 2, 5, '', '', '', 'Analyse d\'un reporting FUTUR en vue d\'en estimer le temps de réalisation et de déterminer si on le récupère dans notre périmètre.\r\n--> Projet avec Marina et Valerie B pour monter un flux du SI FUTUR vers SI Decisionnel SFR, afin de pouvoir construire du reporting BO', 1, 0),
