(40, 'Chrystèle LAOT', '2018-03-13', '2018-03-13', NULL, 4, 4, 5, '', '', '', 'Besoins d\'aide pour faire la RFA. Quel rapport utiliser ? \r\n- Données erronées sur onglet factures par CF\r\n--> Création d\'une onglet avec CF sans Site Installation = données ok, doublons à cause du CI. ', 1, 0),
